import React, { Component } from 'react'

export class JsObject extends Component {
    constructor(){
        super()
        this.state={
            person :{
                firstname: "John",
                lastname: "Doe",
                age: 50,
                eyecolor: "blue"
              }
        }
    }
    render() {
        const {person}=this.state
        return (
            <div>
            <p>
                {
                  person.map(value=>{
                      return <span>{value}</span>
                  })
                }
            </p>
            </div>
        )
    }
}

export default JsObject
